import React from "react";

const Guide = ({ name, status, callback = () => {} }) => {
  return (
    <section>
      <div
        className="concave-1 p-5"
        style={{ cursor: "pointer", fontSize: "30px", fontWeight: "700" }}
        onClick={callback}
      >
        {name}
      </div>
      <p
        className="convex-1 p-3"
        style={{ borderRadius: "30px" }}
        onClick={callback}
      >
        {status}
      </p>
    </section>
  );
};

export default Guide;
